export const explorer = {
    name: 'root',
    isFolder: true,
    item:[{
        name: 'public',
        isFolder: true,
        items: [
            {
                name: "public nested 1",
                isFolder: true,
                items: [
                    {
                        name: "index.html",
                        isFolder: false
                    },
                    {
                        name:"hello.html",
                        isFolder: false
                    }
                ]
            },
            {
                name: "public nested file",
                isFolder: false
            },

        ]
    }]
}
